stylesheets.text:
html, body, div, span h1, h2, h3, p, pre, a, em, img, dl, dt, dd, ol, ul, li, fieldset, form, label, legend, table, caption, tbody, tfoot, thead, tr, th, td { margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 100%; font-family: inherit; vertical-align: baseline; }:focus { outline: 0px; }body { line-height: 1; color: black; background: white; }table { border-collapse: collapse; border-spacing: 0px; caption-side: top; }caption, th, td { text-align: left; font-weight: normal; font-family: monospace; }li { list-style-position: inside; }body { font-family: arial, helvetica, clean, sans-serif; }h2 { font-weight: bold; font-size: 1.5em; color: rgb(46, 52, 54); }p, table, ul, ol, fieldset, caption, #primary, #secondary { margin-bottom: 1em; }table ul { margin-bottom: 0px; list-style: none; }li li { margin-left: 1em; }p { max-width: 40em; }table { border-right: 0px; font-size: 0.9em; }th, td { border: 1px solid rgb(186, 189, 182); padding: 0.3em 0.5em; }th { background: rgb(230, 230, 230); font-weight: bold; }th a { text-decoration: underline; }caption { font-size: 1.1em; font-weight: bold; color: rgb(46, 52, 54); }tr.odd, tr.zebra:nth-of-type(2n) { background: rgb(238, 238, 236); }tr:hover, tr.zebra:hover { background: rgb(255, 255, 200); }a { color: rgb(32, 74, 135); text-decoration: none; }a:hover { text-decoration: none; }a.telephone { color: black; text-decoration: none; }fieldset { border: 1px solid rgb(102, 102, 102); padding: 0.5em; }input { border: 1px solid rgb(51, 51, 51); width: 100%; padding: 0px; margin: 0px; }input.submit { background: rgb(211, 215, 207); width: auto; padding: 0.1em 0.3em; border: 1px solid rgb(46, 52, 54); border-radius: 3px; }input.image { border: 0px; }input.submit:hover { border-color: rgb(85, 87, 83); }legend { font-weight: bold; }label { display: block; font-weight: bold; }fieldset input { width: auto; margin-right: 1em; }fieldset label { width: 100%; }textarea { width: 100%; }#header { background: url("../images/header_top.png") center top repeat-x scroll rgb(147, 40, 34); padding: 15px 1em 4px; margin-bottom: 1em; min-width: 40em; }#header h1 { font-size: 1.3em; font-weight: bold; background: url("../images/logo.png") right center no-repeat; color: rgb(255, 255, 255); margin: 0px; padding: 0px; }#menu { margin: 0.5em; padding: 0.2em; border: 1px solid rgb(186, 189, 182); background: rgb(238, 238, 236); }#content { padding: 0px 1em; line-height: 1.2; }#footer { clear: both; background: rgb(211, 215, 207); color: black; margin-top: 1em; border-top: 1px solid rgb(160, 160, 160); border-bottom: 1px solid rgb(160, 160, 160); padding: 1em 1em 0px; }#footer h2 { float: left; margin-right: 0.5em; }#footer h2::after { content: ":"; }#footer p { max-width: 100%; }#primary input { font-size: 1.3em; }#primary { float: left; width: 19em; background: rgb(255, 244, 194); border: 1px solid rgb(255, 204, 51); border-radius: 3px; }#primary h2, #primary p { margin: 0.5em; }#secondary { margin-left: 20em; min-width: 20em; }#menu li { display: inline; }#menu a { display: inline-block; padding: 0.2em 0.5em; text-decoration: none; color: rgb(0, 0, 0); }#menu form { display: inline; padding: 0.2em 0.5em; float: right; }#menu input { width: auto; }#total { float: right; }#admin { float: right; text-decoration: none; color: rgb(136, 138, 133); }.last { margin: 0px; }.clear { clear: both; }.error { color: rgb(164, 0, 0); font-weight: bold; }.ok { color: rgb(0, 164, 0); font-weight: bold; }.notice { font-weight: bold; font-size: 0.9em; }tr.down { color: rgb(136, 138, 133); }tr.down:hover { color: black; }tr.down .status { border-left-color: rgb(251, 154, 153); }tr.up .status { border-left-color: rgb(178, 223, 138); }tr.admindown .status { border-left-color: rgb(0, 0, 0) !important; }.status { border-left-width: 5px; }li[class*="vlan-"] { border-left: 1em solid transparent; padding-left: 0.5em; }li.vlan-1 { border-left-color: rgb(186, 189, 182); }li.vlan-uplink, li.vlan-2, li.vlan-3 { border-left-color: rgb(234, 56, 146); }li.vlan-4 { border-left-color: rgb(245, 121, 0); }li.vlan-5 { border-left-color: rgb(37, 151, 234); }li.vlan-10 { border-left-color: rgb(136, 138, 133); }li.vlan-15, li.vlan-16 { border-left-color: rgb(78, 154, 6); }li.vlan-20 { border-left-color: rgb(237, 212, 0); }.number { text-align: right; }.code { font-family: monospace; list-style: none; }table.physical td { vertical-align: top; }#panel_row_edit { border: 0px; background: white; vertical-align: middle; }.hidden { display: none; }.img_input { background-image: url("/images/edit.png"); background-position: 0px 0px; background-repeat: no-repeat; border: 0px; background-color: white; width: 20px; }.img_input:hover { cursor: pointer; }@media (max-device-width: 600px) {
  #primary, #secondary { width: 100%; min-width: 0px; float: none; margin: 0px 0px 1em; }
  #header { min-width: 0px; }
  #header h1 { background: transparent; }
  #admin { display: none; }
  input { font-size: 1.3em; }
  a.telephone { color: rgb(32, 74, 135); text-decoration: underline; }
}.tdr_short, .tdr_missing_pins, .tdr_wrong_wiring, .tdr_unknown, .tdr_crosstalk { color: red; font-weight: bold; }.devices { column-width: 13em; }.warning { color: red; }.loading { display: none; vertical-align: bottom; padding-right: 2px; }
